import "./Resume.css";

import { ResumeJson } from "../../Information/index";

function uploadResumeHistory() {
  console.log("eheh");
  console.log(ResumeJson);
  let result = []; /*LEVA OS 2 BLOCOS*/

  var keyBloco = 0;
  for (keyBloco in ResumeJson.resume) {
    let data = ResumeJson.resume[keyBloco];
    // console.log(data.titulo);
    // console.log(data.experiencia);
    let subBlocos = [];
    let keyExp = 0;
    for (keyExp in data.experiencia) {
      //   console.log(data.experiencia[keyExp].nome);
      //   console.log(data.experiencia[keyExp].ano);
      //   console.log(data.experiencia[keyExp].descricao);
      subBlocos.push(
        <div>
          <h3>{data.experiencia[keyExp].nome}</h3>
          <h3>{data.experiencia[keyExp].ano}</h3>
          <h4>{data.experiencia[keyExp].descricao}</h4>
        </div>
      );
    }
    result.push(
      <div>
        <h2>{data.titulo}</h2>
        {subBlocos}
      </div>
    );
  }
  //   let resume = JSON.parse("{ola: eheheh}");
}

const Resume = () => {
  return <div className="mainResume">{uploadResumeHistory()}</div>;
};

export { Resume };
